  bmlfonSubmitData() {
    //check Write permission
    if (!this.appUtility.mbWrite) {
      this.toastMessageService.notifyWarning(this.appUtility.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
      return;
    }
    ;
    if (!this.mbChange && this.FieldExtender.mbChange == false && this.customCtrl.mbChange == false) {
      return;
    }
    ;
    let pbResult;
    pbResult = this.bmlfonValidateFormData();
    this.mbResult = pbResult;
    if (pbResult) {
      //Save e-Signature function -S
      if (this.mbIsEsignature) {
        this.bmlfopenESignatureModal();
        return false;
      }
      //Save e-Signature Function -E
      let data = this.appUtility.bmgfCustomModelTransform(this.customCtrl);
      this.bmlfonAssignCustValues(data);
      // Bug 170424 - Check Mendetory for Header 
      if (this.customCtrl != undefined) {
        if (!this.customCtrl.bmgIsMandatary(this.mObjModel)) {
          return;
        }
      }
      let reqData = {
        JSON: JSON.stringify({
          HeaderData: [{
            ...this.mObjModel
          }],
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      if (this.msFormMode == "I") {
        this.objService.bmlfonSaveData(reqData).subscribe(res => {
          if (res == null) {
            this.toastMessageService.notifyError('Server Error');
            this.mbResult = false;
            return false;
          }
          if (res.Response[0].ErrorCode == "") {
            {
              // this.mbDisabledPrimaryKey = true;
              this.toastMessageService.notifySuccess(this.appUtility.bmgfonTranslate('COMMON.SAVED'));
              if (res.HeaderData.length > 0) {
                this.mObjModel = res.HeaderData[0];
              }
              if (this.msCallFor == "Save") {
                this.msFormMode = "U";
                this.mbInsert = false;
                this.mbChange = false;
                this.FieldExtender.mbChange = false;
                this.customCtrl.mbChange = false;
                this.mbShowDialog = false;
                if (this.msCopyRecord == 'Y') {
                  this.msCopyRecord = 'N';
                }
                // FieldExtender -- start Insert
                let screenKeyValue = this.msScreenName + " — " + this.mObjModel.BankAcTypeID;
                let jsonData = this.FieldExtender.bmlfSaveData(screenKeyValue);
                if (jsonData.length > 0) {
                  this.FieldExtender.bmlfCallApi(jsonData).then(res => {
                    if (res != null) {}
                  });
                }
                ;
                this.bmlfonURL(this.mObjModel.BankAcTypeID);
              } else if (this.msCallFor == "Add") {
                this.mbShowDialog = false;
                this.bmlfonClearControl();
              } else if (this.msCallFor == "Search") {
                this.msFormMode = "I";
                this.mbChange = false;
                this.mbShowDialog = false;
                this.bmlfOnSearchValidation();
              } else if (this.msCallFor == "Copy") {
                this.bmlfonSetFormMode("I", "Copy");
                this.mbShowDialog = false;
                this.bmlfonURL("");
                setTimeout(function () {
                  document.getElementById('txtBankAcType').focus();
                }, 10);
              } else {
                this.mbShowDialog = false;
                this.bmlfonClearControl();
              }
              if (this.msCallFor == "FormClose") {
                this.router.navigate([this.msRoutePath]);
              }
              this.bmlfCheckEsignApplicableOnForm();
            }
          } else {
            //if (res.Response[0].ErrorCode == "") {
            if (this.appUtility.bmgffindString(res.Response[0].ResponseText, 'EXIST')) {
              this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('COMMON.MSG.EXIST'));
            } else {
              this.toastMessageService.notifyError(res.Response[0].ResponseText);
            }
            this.mbResult = false;
            this.mbShowDialog = false;
          }
        });
      } else {
        //update
        this.objService.bmlfonUpdateData(reqData).subscribe(res => {
          if (res == null) {
            this.toastMessageService.notifyError('Server Error');
            this.mbResult = false;
            return false;
          }
          if (res.Response[0].ErrorCode == "") {
            {
              // this.mbDisabledPrimaryKey = true;
              this.bmlfGetDataOnLoad(this.mObjModel.BankAcTypeID);
              this.toastMessageService.notifySuccess(this.appUtility.bmgfonTranslate('COMMON.SAVED'));
              this.mbChange = false;
              this.mbInsert = false;
              this.FieldExtender.mbChange = false;
              this.customCtrl.mbChange = false;
              this.mbShowDialog = false;
              // FieldExtender -- start update
              let screenKeyValue = this.msScreenName + " — " + this.mObjModel.BankAcTypeID;
              let jsonData = this.FieldExtender.bmlfSaveData(screenKeyValue);
              if (jsonData.length > 0) {
                this.FieldExtender.bmlfCallApi(jsonData).then(res => {
                  if (res != null) {}
                });
              }
              ;
            }
            if (this.msCallFor == "FormClose") {
              this.router.navigate([this.msRoutePath]);
            } else if (this.msCallFor == "Copy") {
              this.bmlfonSetFormMode("I", "Copy");
              this.bmlfonURL("");
              setTimeout(function () {
                document.getElementById('txtBankAcType').focus();
              }, 10);
            } else if (this.msCallFor == "Add") {
              this.mbShowDialog = false;
              this.bmlfonClearControl();
            } else if (this.msCallFor == "Search") {
              this.mbShowDialog = false;
              this.bmlfOnSearchValidation();
            }
          } else {
            if (this.appUtility.bmgffindString(res.Response[0].ResponseText, 'EXISTS')) {
              this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('COMMON.MSG.EXIST'));
            } else {
              this.toastMessageService.notifyError(res.Response[0].ResponseText);
            }
            this.mbResult = false;
            this.mbShowDialog = false;
          }
        });
      }
    }
    this.mbShowDialog = false;
  }
