  bmlfOpenLookupModal(psScreenName, psLookupCaption, psLookUpKey, psEvent, psValue, psType, psEleId, pnumRowIdx = null, MutiSelectionLookup = false) {
    this.mbIsLoading = true;
    this.marrLookupGridData = [];
    this.mobjLookupKeyData = {};
    let psReqData;
    this.mbMutiSelectionLookup = MutiSelectionLookup;
    if (this.mObjModel.BankId == undefined) {
      this.msBankDescription = "";
    }
    if (psLookupCaption == this.msLookupCaption || psLookupCaption == this.msLookupCaptionForBank) {
      psReqData = {
        "ScreenName": psScreenName,
        "LookUpKey": psLookUpKey,
        "Filter1": "",
        "Filter2": "",
        "Filter3": "",
        "Filter4": "",
        "Filter5": ""
      };
    }
    ;
    this.objLookupService.getLookup(psReqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res == null) {
        this.bmlfOpenErrorBlock('COMMON.MSG.NODATA');
        return false;
      }
      let obj1 = {};
      if (Object.entries(res).length > 0 && res.LookupData.length > 0) {
        if (psLookUpKey == this.msLookUpKey) {
          res.LookupData.forEach(ele => {
            ele.Recdate = moment__WEBPACK_IMPORTED_MODULE_0__(ele.Recdate).format(this.msCustomDateFormat.toUpperCase());
            // ele.ModifyDate = moment(ele.ModifyDate).format(this.msCustomDateFormat.toUpperCase());
            // ele.CreateDate = moment(ele.CreateDate).format(this.msCustomDateFormat.toUpperCase());
          });
        }

        this.marrLookupGridData = res.LookupData;
        this.mnumLineItemRowIndex = pnumRowIdx;
        this.mobjLookupKeyData.field = psLookupCaption;
        this.mobjLookupKeyData.gridData = this.marrLookupGridData;
        this.mobjLookupKeyData.type = psType;
        this.mobjLookupKeyData.eleId = psEleId;
        /* Abhay/08-July-2020/Bug# 140776*/
        if (psValue) {
          this.mobjLookupKeyData.searchValue = psValue.toString();
        } else {
          this.mobjLookupKeyData.searchValue = '';
        }
        if (psEvent == 'blur' && psValue) {
          let parrFilterdArr = [];
          let pobjFirstInput = Object.keys(this.marrLookupGridData[0])[0];
          parrFilterdArr = this.marrLookupGridData.filter(obj => {
            if (obj[pobjFirstInput].toString().toUpperCase() == psValue.toString().toUpperCase()) {
              return obj;
            }
          });
          if (parrFilterdArr.length == 1) {
            this.mobjLookupKeyData.value = parrFilterdArr[0];
            this.mobjLookupKeyData.valueKey = parrFilterdArr[0][pobjFirstInput];
            this.bmlfonSaveLookupField(this.mobjLookupKeyData);
            this.mbIsLookupModal = false;
          } else {
            this.mbIsLookupModal = true;
          }
        } else if (psEvent == 'click') {
          this.mbIsLookupModal = true;
        }
      } else {
        this.bmlfOpenErrorBlock('COMMON.MSG.NODATA');
      }
    }, err => {
      console.log(err);
      this.mbIsLoading = false;
    });
  }
