  bmlfonValidateFormData() {
    let pbFlag = true;
    if (this.mObjModel.TemplateID == "") {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('BankLayoutMaster.Msg.Key'));
      document.getElementById('txtTemplateID').focus();
      pbFlag = false;
    } else if (this.mObjModel.BankId == undefined || this.mObjModel.BankId == 0) {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('BankLayoutMaster.Msg.Key1'));
      document.getElementById('txtBankId').focus();
      pbFlag = false;
    } else if (this.mObjModel.DescLength == undefined || this.mObjModel.DescLength == 0) {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('BankLayoutMaster.Msg.Key2'));
      document.getElementById('txtDescLength').focus();
      pbFlag = false;
    } else if (this.mObjModel.StatingRowNum == undefined || this.mObjModel.StatingRowNum == 0) {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('BankLayoutMaster.Msg.Key3'));
      document.getElementById('txtStatingrownum').focus();
      pbFlag = false;
    } else if (this.mArrGrid.length == 0) {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.objToastService.notifyError(this.appUtility.bmgfonTranslate('BankLayoutMaster.Msg.AddLineDetatils'));
      document.getElementById('cmdAddLineToGrid').focus();
      pbFlag = false;
    } else if (this.mArrGrid.length > 0) {
      let piRowNumber = 0;
      // if (this.mbSearchEvent == true) {
      //   return false;
      // }
      this.mArrGrid.forEach(element => {
        piRowNumber += 1;
        if (element.Value == '') {
          this.objToastService.notifyError(this.appUtility.bmgfonTranslate('BankLayoutMaster.Msg.Key6') + " " + piRowNumber.toString());
          document.getElementById('txtValue' + piRowNumber.toString()).focus();
          pbFlag = false;
        } else if (element.ColumnHeading == '') {
          this.objToastService.notifyError(this.appUtility.bmgfonTranslate('BankLayoutMaster.Msg.Key5') + " " + piRowNumber.toString());
          document.getElementById('txtColumnHeading' + piRowNumber.toString()).focus();
          pbFlag = false;
        }
      });
    }
    return pbFlag;
  }
