  bmlfonInserLine(parrLineData) {
    let psTempUser = "";
    parrLineData.forEach(ele => {
      if (psTempUser == "") {
        psTempUser = ele.User_ID;
        this.mObjModel.Name = ele.User_Description;
      } else {
        psTempUser = psTempUser + "|" + ele.User_ID;
      }
    });
    this.mObjModel.UserID = psTempUser;
  }
  bmlfGetInputColumn(psfield) {
    if (psfield == this.msLookupCaptionForGLAccount) {
      return 'Acct';
    } else if (psfield == this.msLookupCaptionForCurrency) {
      return 'Curr_Id';
    } else if (psfield == this.msLookupCaptionForUser) {
      return "UserID";
    }
  }
