  bmlfCloseLookupModal(pobjData) {
    this.mbIsLookupModal = pobjData.isLookupModal;
    if (pobjData.eleId != null) {
      let psInputKey = this.bmlfGetInputColumn(pobjData.field);
      let parrFilterData = [];
      if (psInputKey) {
        parrFilterData = pobjData.gridData.filter(obj => obj[psInputKey].toUpperCase() == pobjData.searchValue.toUpperCase());
      }
      if (parrFilterData.length == 0) {
        let psModelField = this.bmlfGetModelField(pobjData.field, pobjData.eleId);
        this.mObjModel[psModelField] = '';
      }
      document.getElementById(pobjData.eleId).focus();
    }
  }
  bmlfonClose() {
    if (!this.mbChange && !this.FieldExtender.mbChange && !this.customCtrl.mbChange) {
      this.router.navigate([this.msRoutePath]);
    } else {
      this.mbShowDialog = true;
      this.msCallFor = "FormClose";
    }
  }
  bmlfonDialogAction(action) {
    if (action == 'No') {
      this.mbShowDialog = false;
      this.mbChange = false;
      if (this.msCallFor == "FormClose") {
        this.router.navigate([this.msRoutePath]);
      } else if (this.msCallFor == "Add") {
        this.bmlfonClearControl();
      } else if (this.msCallFor == "Copy") {
        this.bmlfonSetFormMode("I", "Copy");
      } else if (this.msCallFor == "Search") {
        this.bmlfOpenLookupModal(this.msScreenName, this.msLookupCaption, this.msLookUpKey, 'click', '', 'custom', 'txtCustItemkey');
      } else {
        return;
      }
    } //Yes
    else if (action == 'Yes' && this.msCallFor == "FormClose") {
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Add") {
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Copy") {
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Search") {
      this.bmlfonSubmitData();
      this.mbShowDialog = false;
    } else if (action == 'Yes') {
      // call update function
      this.mbChange = false;
      this.mbShowDialog = false;
      this.msFormMode = "U";
      this.mbDisabledPrimaryKey = true;
    } else {
      this.mbShowDialog = false;
    }
    setTimeout(function () {
      document.getElementById('txtBMEAcct').focus();
    }, 10);
  }
