  //Search start
  bmlfOnSearch(psScreenName, psLookupCaption, psLookUpKey, psEvent, psValue, psType, psEleId, pnumRowIdx = null) {
    this.mbSearchEvent = true;
    let pbResult = this.bmlfonValidateFormData();
    if (pbResult == false) {
      this.mbSearchEvent = false;
      if (this.mbInsert == false) {
        return;
      }
    }
    if (!this.mbChange && !this.FieldExtender.mbChange && !this.customCtrl.mbChange) {
      this.bmlfOpenLookupModal(psScreenName, psLookupCaption, psLookUpKey, psEvent, psValue, psType, psEleId, pnumRowIdx);
    } else {
      this.msCallFor = "Search";
      this.mbShowDialog = true;
    }
  }
  bmlfOpenLookupModal(psScreenName, psLookupCaption, psLookUpKey, psEvent, psValue, psType, psEleId, pnumRowIdx = null) {
    this.mbIsLoading = true;
    this.marrLookupGridData = [];
    this.mobjLookupKeyData = {};
    if (psEvent == 'blur' && (psValue == undefined || psValue == '')) {
      return false;
    }
    let psReqData;
    if (psLookUpKey == this.msLookupKey) {
      psReqData = {
        "ScreenName": psScreenName,
        "LookUpKey": psLookUpKey,
        "Filter1": "",
        "Filter2": "",
        "Filter3": "",
        "Filter4": "",
        "Filter5": ""
      };
    }
    this.objLookupService.getLookup(psReqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res == null) {
        this.bmlfOpenErrorBlock('COMMON.MSG.NODATA');
        return false;
      }
      if (Object.entries(res).length > 0 && res.LookupData.length > 0) {
        res.LookupData.forEach(ele => {
          ele.RecDate = moment__WEBPACK_IMPORTED_MODULE_1__(ele.RecDate).format(this.msCustomDateFormat.toUpperCase());
        });
        this.marrLookupGridData = res.LookupData;
        this.mnumLineItemRowIndex = pnumRowIdx;
        this.mobjLookupKeyData.field = psLookupCaption;
        this.mobjLookupKeyData.gridData = this.marrLookupGridData;
        this.mobjLookupKeyData.type = psType;
        this.mobjLookupKeyData.eleId = psEleId;
        if (psValue) {
          this.mobjLookupKeyData.searchValue = psValue;
        } else {
          this.mobjLookupKeyData.searchValue = '';
        }
        if (psEvent == 'blur' && psValue) {
          let parrFilterdArr = [];
          /** --- Check : enter key matching record found. if find single row then direct call save lookup function --*/
          let pobjFirstInput = Object.keys(this.marrLookupGridData[0])[0];
          parrFilterdArr = this.marrLookupGridData.filter(obj => {
            if (obj[pobjFirstInput].toUpperCase() == psValue.toUpperCase()) {
              return obj;
            }
          });
          if (parrFilterdArr.length == 1) {
            this.mobjLookupKeyData.value = parrFilterdArr[0];
            this.mobjLookupKeyData.valueKey = parrFilterdArr[0][pobjFirstInput];
            this.bmlfSaveLookupField(this.mobjLookupKeyData);
            this.mbIsLookupModal = false;
          } else {
            this.mbIsLookupModal = true;
          }
        } else if (psEvent == 'click') {
          this.mbIsLookupModal = true;
        }
      } else {
        this.bmlfOpenErrorBlock('COMMON.MSG.NODATA');
      }
    }, err => {
      console.log(err);
      this.mbIsLoading = false;
    });
  }
  bmlfOpenErrorBlock(psMsg) {
    this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate(psMsg));
  }
  bmlfSaveLookupField(pobjEvent) {
    this.mbIsLookupModal = false;
    if (pobjEvent.field == this.msLookupCaption) {
      if (this.mObjModel.PaymentModeID != undefined) {
        let jsonObj = {
          PaymentModeID: pobjEvent.valueKey
        };
        this.appUtility.refreshUrlAndInitCustom('/main/commondata/refresh', this.msRoutePathManage, true, jsonObj);
        this.bmlfGetDataOnLoad(pobjEvent.valueKey);
      }
    }
  }
  bmlfCloseLookupModal(pobjEvent) {
    this.mbIsLookupModal = pobjEvent.isLookupModal;
    document.getElementById(pobjEvent.eleId).focus();
  }
  bmlfonClose() {
    if (!this.mbChange && !this.FieldExtender.mbChange && !this.customCtrl.mbChange) {
      this.router.navigate([this.msRoutePath]);
    } else {
      this.mbShowDialog = true;
      this.msCallFor = "FormClose";
    }
  }
  bmlfonDialogAction(action) {
    if (action == 'No') {
      this.mbShowDialog = false;
      if (this.msCallFor == "FormClose") {
        this.router.navigate([this.msRoutePath]);
      } else if (this.msCallFor == "Add") {
        this.bmlfonClearControl();
      } else if (this.msCallFor == "Copy") {
        this.bmlfonSetFormMode("I", "Copy");
      } else if (this.msCallFor == "Search") {
        this.bmlfOpenLookupModal(this.msScreenName, this.msLookupCaption, this.msLookupKey, 'click', '', 'custom', 'btnSearch');
      } else {
        return;
      }
    } //Yes
    else if (action == 'Yes' && this.msCallFor == "FormClose") {
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Add") {
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Copy") {
      this.bmlfonSubmitData();
    } else if (action == 'Yes' && this.msCallFor == "Search") {
      this.mbShowDialog = false;
      this.bmlfonSubmitData();
    } else if (action == 'Yes') {
      this.mbChange = false;
      this.mbShowDialog = false;
      this.msFormMode = "U";
    } else {
      this.mbShowDialog = false;
    }
    setTimeout(function () {
      document.getElementById('txtPaymentMode').focus();
    }, 10);
  }
  bmlfOnSearchValidation() {
    this.bmlfOpenLookupModal(this.msScreenName, this.msLookupCaption, this.msLookupKey, 'click', '', 'custom', 'btnSearch');
  }
  bmlfGetDataOnLoad(msPaymentModeID) {
    let reqData = {
      JSON: JSON.stringify({
        HeaderData: [{
          PaymentModeID: msPaymentModeID
        }],
        RequestData: [{
          "ResponseText": "",
          "ErrorCode": ""
        }]
      })
    };
    this.objService.bmlfonGetData(reqData).subscribe(res => {
      if (res.HeaderData.length > 0) {
        this.msFormMode = "U";
        // this.mbDisabledPrimaryKey = true;
        this.mObjModel = res.HeaderData[0];
        this.mbCustomControl = true;
        this.bmlfCheckEsignApplicableOnForm();
      } else {
        this.msFormMode = "I";
        // this.mbDisabledPrimaryKey = false;
      }

      if (this.msCopyRecord == "Y") {
        this.bmlfonSetFormMode("I", "Copy");
      }
    });
    this.bmlfonURL(msPaymentModeID);
  }
