  //---------------------------------------------------------------------------------------
  //Delete
  bmlfonDelete() {
    if (this.mbDiabledAllFields == true) {
      this.objToastService.notifyError(this.objUtils.bmgfonTranslate('BANKINGGLENTRY.MSG.DELETECHECK'));
      return;
    }
    //check delete permission
    if (!this.objUtils.mbDelete) {
      this.objToastService.notifyWarning(this.objUtils.bmgfonTranslate('COMMON.PERMISSION_DELETE'));
      return;
    }
    ;
    if (this.mbInsert && !this.mbChange) {
      if (this.msCallFor == "" || this.msCallFor == "Add") {
        this.objToastService.notifyWarning(this.objUtils.bmgfonTranslate('COMMON.MSG.NODATADELETE'));
      }
      this.bmlfonClearControl();
      return false;
    }
    if (this.bmlfonisEmpty(this.mObjModel.JrnlBtchNo) && !this.mbChange) {
      this.objToastService.notifyWarning(this.objUtils.bmgfonTranslate('COMMON.MSG.NODATADELETE'));
      this.bmlfonClearControl();
      return false;
    }
    this.mbShowDeleteDialog = true;
  }
  //---------------------------------------------------------------------------------------
  bmlfonisEmpty(value) {
    return typeof value === "undefined" || value === null || value === '';
  }
  //---------------------------------------------------------------------------------------
  bmlfonDeleteDialogAction(action) {
    if (action == 'No') {
      this.mbShowDeleteDialog = false;
    } else if (action == 'Yes') {
      if (this.msFormMode == "I" && (this.mbChange == true || this.FieldExtender.mbChange == true || this.customCtrl.mbChange == true)) {
        this.mbShowDeleteDialog = false;
        this.objToastService.notifySuccess(this.objUtils.bmgfonTranslate('COMMON.MSG.DELETE'));
        this.bmlfonClearControl();
        return;
      } else if (this.mbInsert && this.mbChange) {
        this.mbShowDeleteDialog = false;
        let deleteKey = this.msscreenName + " — " + this.mObjModel.JrnlBtchNo;
        this.FieldExtender.bmgfDeleteData(deleteKey);
        this.bmlfonClearControl();
        this.objToastService.notifySuccess(this.objUtils.bmgfonTranslate('COMMON.MSG.MSGDELETE'));
        return false;
      }
      let reqData = {
        JSON: JSON.stringify({
          HeaderData: [{
            JrnlBtchNo: this.mObjModel.JrnlBtchNo.trim()
          }],
          Response: [{
            "ResponseText": "",
            "ErrorCode": ""
          }]
        })
      };
      this.BankingGLEntryService.bmlfonDeleteBankingGLEntry(reqData).subscribe(res => {
        if (res == null) {
          this.objToastService.notifyError('Server Error');
          return false;
        }
        if (res.Response[0].ErrorCode == "") {
          if (res.Response[0].ResponseText.search("Reference") != -1) {
            this.objToastService.notifyError(this.objUtils.bmgfonTranslate('COMMON.MSG.EXIST_REF'));
            this.mbShowDeleteDialog = false;
            return;
          } else if (res.Response[0].ResponseText.toUpperCase().search('DELETED') != -1) {
            this.mbShowDeleteDialog = false;
            this.objToastService.notifySuccess(this.objUtils.bmgfonTranslate('COMMON.MSG.DELETE'));
            this.bmlfonClearControl();
          } else {
            this.objToastService.notifyError(res.Response[0].ResponseText);
            this.mbShowDeleteDialog = false;
          }
        } else {
          this.objToastService.notifyError(res.Response[0].ResponseText);
          this.mbShowDeleteDialog = false;
        }
      });
    }
  }
