  //---------------------------------------------------------------------------------------
  bmlfSaveLookupField(pobjEvent) {
    let psInputDesKey = this.bmlfGetInputDesColumn(pobjEvent.field);
    this.mbIsLookupModal = false;
    if (pobjEvent.field == "Banking GL Entry") {
      this.mObjModel[psInputDesKey] = pobjEvent.value.JrnlBtchNo; //pobjEvent.valueKey.trim();
      if (this.mObjModel[psInputDesKey] != "") {
        this.msStatus = pobjEvent.value.Status;
        let jsonObj = {
          JrnlBtchNo: this.mObjModel[psInputDesKey],
          Status: pobjEvent.value.Status
        };
        this.objUtils.refreshUrlAndInitCustom('/main/commondata/refresh', '/main/bankcash/banking-gl-entry/manage', true, jsonObj);
        this.bmlfGetDataOnLoad(this.mObjModel[psInputDesKey]);
      }
    } else if (pobjEvent.field == "Finance Series") {
      this.mObjModel[psInputDesKey] = pobjEvent.valueKey;
      this.mbChange = true;
    } else if (pobjEvent.field == "Currency") {
      this.mObjModel.CurrencyKey = pobjEvent.valueKey;
      this.msCurrencyDesc = pobjEvent.value.Description;
      this.mbChange = true;
    } else if (pobjEvent.field == "Bank Master") {
      this.mObjModel.Acct = pobjEvent.valueKey;
      this.msAccDesc = pobjEvent.value.Description.trim();
      this.mObjModel.Description = pobjEvent.value.BankName.trim(); //Bank Name
      this.msBankAccNo = pobjEvent.value.BankAcNo;
      this.mObjModel.AcctCurrency = pobjEvent.value.CurrencyKey;
      this.mObjModel.NAPstID = pobjEvent.value.BankID;
      this.mbChange = true;
    } else if (pobjEvent.field == "Accounts") {
      this.mArrGLEntryGrid[this.mnumLineItemRowIndex]['Acct'] = pobjEvent.valueKey.trim();
      this.mArrGLEntryGrid[this.mnumLineItemRowIndex]['Account'] = pobjEvent.value.Description.trim();
      this.mbChange = true;
    } else if (pobjEvent.field == "Dimension 1") {
      this.mArrGLEntryGrid[this.mnumLineItemRowIndex]['Dimension1'] = pobjEvent.valueKey.trim();
      this.mbChange = true;
    } else if (pobjEvent.field == "Dimension 2") {
      this.mArrGLEntryGrid[this.mnumLineItemRowIndex]['Dimension2'] = pobjEvent.valueKey.trim();
      this.mbChange = true;
    } else if (pobjEvent.field == "Dimension 3") {
      this.mArrGLEntryGrid[this.mnumLineItemRowIndex]['Dimension3'] = pobjEvent.valueKey.trim();
      this.mbChange = true;
    } else if (pobjEvent.field == "Dimension 4") {
      this.mArrGLEntryGrid[this.mnumLineItemRowIndex]['Dimension4'] = pobjEvent.valueKey.trim();
      this.mbChange = true;
    } else if (pobjEvent.field == "Dimension 5") {
      this.mArrGLEntryGrid[this.mnumLineItemRowIndex]['Dimension5'] = pobjEvent.valueKey.trim();
      this.mbChange = true;
    }
  }
