  //---------------------------------------------------------------------------------------
  bmlfonValidateFormData() {
    if (this.mObjModel.JrnlBtchNo.trim() == "") {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.objToastService.notifyError(this.objUtils.bmgfonTranslate('BANKINGGLENTRY.MSG.SELECTSERIES'));
      setTimeout(function () {
        document.getElementById('txtJrnlBtchNo').focus();
      }, 10);
      return false;
    }
    if (this.mObjModel.AplDate == null) {
      this.objToastService.notifyError(this.objUtils.bmgfonTranslate('BANKINGGLENTRY.MSG.JOURNALBLKDATECHK'));
      setTimeout(function () {
        document.getElementById('dtAplDate').focus();
      }, 10);
      return false;
    }
    if (this.mObjModel.PstDate == null) {
      this.objToastService.notifyError(this.objUtils.bmgfonTranslate('BANKINGGLENTRY.MSG.POSTINGBLKDATECHK'));
      setTimeout(function () {
        document.getElementById('dtPstDate').focus();
      }, 10);
      return false;
    }
    if (this.mObjModel.Acct == "") {
      this.objToastService.notifyError(this.objUtils.bmgfonTranslate('BANKINGGLENTRY.MSG.BANKACCTCHECK'));
      setTimeout(function () {
        document.getElementById('txtAcct').focus();
      }, 10);
      return false;
    }
    if (this.mArrGLEntryGrid.length == 0) {
      if (this.mnTotalCreditAmount == 0 && this.mnTotalDebitAmount == 0) {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('BANKINGGLENTRY.MSG.ZEROTOTALAMOUNT'));
        return false;
      }
    }
    if (this.mnTotalCreditAmount > 0 && this.mnTotalDebitAmount > 0) {
      if (Number(this.mnDifferenceAmount == 0)) {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('BANKINGGLENTRY.MSG.DIFFAMOUNTZERO'));
        return false;
      }
    }
    //--------------Grid Validation-----------------
    let errRow = 0;
    let errRowNum = '';
    let errFiled = '';
    if (this.mArrGLEntryGrid.length > 0) {
      this.mArrGLEntryGrid.forEach(ele => {
        errRow = Number(errRow) + 1;
        if (errFiled == '') {
          if (ele.DrAmt == 0 && ele.CrAmt == 0) {
            if (errRow == 1) {
              errRowNum = errRow.toString();
            } else {
              errRowNum = errRowNum + " ," + errRow.toString();
            }
            errFiled = 'Amount';
          }
          if (ele.Acct == '') {
            errFiled = 'Account';
          }
        }
      });
      if (errFiled == "Account") {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('BANKINGGLENTRY.MSG.ROWENTRYBLANK') + ' ' + errRow);
        return false;
      } else if (errFiled == "Amount") {
        this.objToastService.notifyError(this.objUtils.bmgfonTranslate('BANKINGGLENTRY.MSG.ROWZEROTOTALAMOUNT') + ' ' + errRowNum);
        return false;
      }
    }
    //--------------Grid Validation-----------------
    //Validate Field Extender -- Start
    if (this.FieldExtender.mbChange || this.customCtrl.mbChange || this.mbChange) {
      let resultString = this.FieldExtender.bmgfValidationCheck();
      if (resultString.value == false) {
        this.objToastService.notifyWarning(resultString.msg);
        return false;
      }
    }
    return true;
  }
