  bmlfGetDataOnLoad(msJrnlBtchNo) {
    let reqData;
    let psStatus = 'POSTED';
    if (this.msStatus == "HOLD" || this.msStatus == "NEW" || this.msStatus == "") {
      psStatus = 'UNPOSTED';
    }
    //else if (this.msStatus == "VOID") {
    //   psStatus = 'VOID';
    // }
    reqData = {
      JSON: JSON.stringify({
        HeaderData: [{
          JrnlBtchNo: this.msJrnlBtchNo,
          Status: psStatus
        }],
        Response: [{
          "ResponseText": "",
          "ErrorCode": ""
        }]
      })
    };
    this.mbIsLoading = true;
    this.objService.bmlfonGetData(reqData).subscribe(res => {
      this.mbIsLoading = false;
      if (res.HeaderData.length > 0) {
        this.msFormMode = "U";
        this.mbDisabledPrimaryKey = true;
        this.appUtility.bmlfTransformCustomFieldsGet(res.HeaderData[0]);
        this.mObjModel = res.HeaderData[0];
        this.mObjModel2 = res.HeaderData[1];
        if (this.mObjModel.TrnAmt < 0) {
          this.mObjModel.TrnAmt = this.mObjModel.TrnAmt * -1;
          this.mObjModel.NatAmt = this.mObjModel.NatAmt * -1;
          this.mObjModel.AcctCurrencyAmt = this.mObjModel.AcctCurrencyAmt * -1;
          this.bmlfonAmountChange('Load');
        }
        if (this.mObjModel.Type == "B") {
          this.mbIsBank = true;
          this.mbIsCash = false;
        } else if (this.mObjModel.Type == "C") {
          this.mbIsCash = true;
          this.mbIsBank = false;
        }
        this.mObjModel.AplDate = new Date(this.mObjModel.AplDate); //.format(this.mscustomdateformat.toUpperCase()));
        this.mObjModel.PstDate = new Date(this.mObjModel.PstDate); //.format(this.mscustomdateformat.toUpperCase()));
        this.mObjModel.User6 = new Date(this.mObjModel.User6); //.format(this.mscustomdateformat.toUpperCase()));
        this.msPostedDesc = "NEW";
        if (this.msStatus == "POSTED" || this.msStatus == "VOID") {
          this.msPostedDesc = this.msStatus;
          this.mbIsHoldorPost = true;
        } else if (this.mObjModel.Posted == true) {
          this.msPostedDesc = "HOLD";
          this.mbIsHoldorPost = true;
        }
        //this.mObjModel.Itemkey = res.HeaderData[0]["Itemkey"];
        this.mbCustomControl = true;
        //Get Descriptions ---------------S
        //if (this.msCopyRecord != "Y") {
        this.bmlfGetAccountDesc("B", this.mObjModel.NAPstID);
        this.bmlfGetAccountDesc("T", this.mObjModel2.NAPstID);
        this.bmlfGetPaymentModeID();
        this.bmlfGetBankCashBalance('B');
        this.bmlfGetBankCashBalance('T');
        // this.bmlfGetConversionFactor();
        if (this.mObjModel.AcctCurrency == this.mObjModel2.AcctCurrency) {
          this.mbCurrencyFact = true;
        } else {
          this.mbCurrencyFact = false;
        }
        //}
        this.bmlfCheckEsignApplicableOnForm();
      } else {
        this.msFormMode = "I";
        this.mbDisabledPrimaryKey = false;
      }
      if (this.msCopyRecord == "Y") {
        // this.msFormMode = "I";
        // this.mObjModel.JrnlBtchNo = ""; // clear the primary key
        // this.mbDisabledPrimaryKey = false;
        //this.mbChange = true; //Avanish 6Jul20 SCR 138461
        this.bmlfonSetFormMode("I", "Copy");
        //setTimeout(function () { document.getElementById('txtJrnlBtchNo').focus(); }, 10);
      }
    });

    this.bmlfonURL(this.mskeyValue);
  }
