  bmlfSaveLookupField(pobjEvent) {
    this.mbIsLookupModal = false;
    if (pobjEvent.field == this.msCaptionForSeries) {
      this.mObjModel.JrnlBtchNo = pobjEvent.value["Series"].trim();
      this.mbChange = true;
    } else if (pobjEvent.field == this.msCaptionForCheckbookID) {
      this.mObjModel.Itemkey = pobjEvent.value["ChqBookID"].trim();
      this.mObjModel.NAPstID = pobjEvent.value["BankID"];
      this.mObjModel.Acct = pobjEvent.value["BmeAcct"].trim();
      this.msByAccDesc = pobjEvent.value["Description"].trim();
      this.msByAccName = pobjEvent.value["BankName"].trim();
      this.mnODLimit = Number(pobjEvent.value["ODLimit"]);
      this.mObjModel.AcctCurrency = pobjEvent.value["CurrencyKey"].trim();
      this.SetChqNo(pobjEvent);
      this.bmlfGetBankCashBalance('B');
      this.bmlfonChange();
    } else if (pobjEvent.field == this.msCaptionForByAccount) {
      this.mObjModel.Acct = pobjEvent.value["BMEAcct"].trim();
      this.msByAccDesc = pobjEvent.value["Description"].trim();
      this.msByAccName = pobjEvent.value["Name"].trim();
      this.mnODLimit = Number(pobjEvent.value["ODLimit"]);
      this.mObjModel.NAPstID = pobjEvent.value["ID"];
      this.mObjModel.AcctCurrency = pobjEvent.value["CurrencyKey"].trim();
      this.bmlfGetBankCashBalance('B');
      this.bmlfGetConversionFactor();
      this.bmlfonChange();
    } else if (pobjEvent.field == this.msCaptionForToAccount) {
      this.mObjModel2.Acct = pobjEvent.value["BMEAcct"].trim();
      this.msToAccDesc = pobjEvent.value["Description"].trim();
      this.msToAccName = pobjEvent.value["Name"].trim();
      this.mObjModel2.NAPstID = pobjEvent.value["ID"];
      this.mObjModel2.AcctCurrency = pobjEvent.value["CurrencyKey"].trim();
      this.bmlfGetBankCashBalance('T');
      this.bmlfGetConversionFactor();
      this.bmlfonChange();
    } else if (pobjEvent.field == this.msCaptionForPaymentMode) {
      this.mObjModel.Vend_CustKey = pobjEvent.value["PaymentMode"].trim();
      this.mnumPaymentModeID = pobjEvent.value["PaymentModeID"];
      this.bmlfonChange();
    } else if (pobjEvent.field == 'Search' || pobjEvent.field == "txtSearchkey") {
      this.mObjModel.JrnlBtchNo = pobjEvent.valueKey.trim();
      this.mObjModel.AplDate = pobjEvent.value["Date"];
      this.mObjModel.Acct = pobjEvent.value["AccountNo"];
      if (this.mObjModel.JrnlBtchNo != "") {
        //// Customization Refresh Url
        let jsonObj = {
          JrnlBtchNo: this.mObjModel.JrnlBtchNo
        };
        this.appUtility.refreshUrlAndInitCustom('/main/bankcash/refresh', this.msRoutePathManage, true, jsonObj);
        this.msCopyRecord = "";
        this.bmlfGetDataOnLoad(this.mObjModel.JrnlBtchNo);
      }
    }
  }
  SetChqNo(pobjEvent) {
    if (this.mObjModel.Itemkey != '') {
      let pnumLastChqNo = 0;
      let pnumStartChqNo = 0;
      let pnumEndChqNo = 0;
      pnumStartChqNo = Number(pobjEvent.value["StartChqNo"]);
      pnumLastChqNo = Number(pobjEvent.value["LastChqNo"]);
      pnumEndChqNo = Number(pobjEvent.value["EndChqNo"]);
      this.mObjModel.ParentdocNo = '';
      if (pnumLastChqNo > 0 && pnumEndChqNo > pnumLastChqNo) {
        this.mObjModel.ParentdocNo = String(pnumLastChqNo + 1);
      } else if (pnumLastChqNo == 0) {
        this.mObjModel.ParentdocNo = String(pnumStartChqNo);
      }
    }
  }
  SetChqNoFromService() {
    if (this.mObjModel.Itemkey != '' && this.mObjModel.NAPstID > 0) {
      let pobjReqData = {
        ScreenName: 'Contra Entry',
        LookUpKey: 'LastChqNo',
        Filter1: this.mObjModel.Itemkey,
        Filter2: this.mObjModel.NAPstID
      };
      this.userService.GETGeneralSqlData(pobjReqData).subscribe(res => {
        if (res.LookupData.length > 0) {
          let pnumLastChqNo = 0;
          let pnumStartChqNo = 0;
          let pnumEndChqNo = 0;
          pnumStartChqNo = Number(res.LookupData[0]["StartChqNo"]);
          pnumLastChqNo = Number(res.LookupData[0]["LastChqNo"]);
          pnumEndChqNo = Number(res.LookupData[0]["EndChqNo"]);
          this.mObjModel.ParentdocNo = '';
          if (pnumLastChqNo > 0 && pnumEndChqNo > pnumLastChqNo) {
            this.mObjModel.ParentdocNo = String(pnumLastChqNo + 1);
          } else if (pnumLastChqNo == 0) {
            this.mObjModel.ParentdocNo = String(pnumStartChqNo);
          }
        }
      });
    }
  }
