  // Set Lookup Value Column
  bmlfGetInputColumn(psfield) {
    if (psfield == this.msCaptionForSeries) {
      return 'Series';
    } else if (psfield == this.msCaptionForPaymentMode) {
      return 'PaymentMode';
    } else if (psfield == this.msCaptionForCheckbookID) {
      return 'ChqBookID';
    } else if (psfield == this.msCaptionForByAccount) {
      return 'BMEAcct';
    } else if (psfield == this.msCaptionForToAccount) {
      return 'BMEAcct';
    }
  }
  //Return Model Field
  bmlfGetModelField(psfield, eleId) {
    if (psfield == this.msCaptionForSeries) {
      return 'JrnlBtchNo';
    } else if (psfield == this.msCaptionForPaymentMode) {
      return 'Vend_CustKey';
    } else if (psfield == this.msCaptionForCheckbookID) {
      return 'Itemkey';
    } else if (psfield == this.msCaptionForByAccount) {
      return 'Acct';
    } else if (psfield == this.msCaptionForToAccount) {
      return 'Acct';
    }
  }
  bmlfCloseLookupModal(pobjData) {
    this.mbIsLookupModal = pobjData.isLookupModal;
    if (pobjData.eleId != null) {
      let psInputKey = this.bmlfGetInputColumn(pobjData.field);
      let parrFilterData = [];
      if (psInputKey && pobjData.searchValue != null) {
        parrFilterData = pobjData.gridData.filter(obj => obj[psInputKey].toUpperCase() == pobjData.searchValue.toUpperCase());
      }
      if (parrFilterData.length == 0 || pobjData.searchValue == null) {
        let psModelField = this.bmlfGetModelField(pobjData.field, pobjData.eleId);
        if (pobjData.eleId == 'txtToAccount') {
          this.mObjModel2[psModelField] = '';
        } else {
          this.mObjModel[psModelField] = '';
        }
        // this.bmlfonChange();
      }

      document.getElementById(pobjData.eleId).focus();
    }
  }
