  //Add
  bmlfonAdd() {
    //check Write permission
    if (!this.appUtility.mbWrite) {
      this.toastMessageService.notifyWarning(this.appUtility.bmgfonTranslate('COMMON.PERMISSION_WRITE'));
      return;
    }
    ;
    this.msCallFor = "Add";
    let pbResult = this.bmlfonValidateFormData();
    if (pbResult == true) {
      if (!this.mbChange && !this.FieldExtender.mbChange && !this.customCtrl.mbChange) {
        this.bmlfonClearControl();
      } else {
        // Ask for Yes No Cancel
        this.mbShowDialog = true;
      }
    }
  }
  bmlfonValidateFormData() {
    if (this.mObjModel.JrnlBtchNo.trim() == "") {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('CONTRAENTRY.VALID.ENTERCONTRAKEY'));
      setTimeout(function () {
        document.getElementById('txtJrnlBtchNo').focus();
      }, 10);
      return false;
    } else if (this.mObjModel.Acct.trim() == "") {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('CONTRAENTRY.VALID.ENTERBYACCOUNT'));
      setTimeout(function () {
        document.getElementById('txtByAccount').focus();
      }, 10);
      return false;
    } else if (this.mObjModel.Vend_CustKey.trim() == "" && this.mbIsBank) {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('CONTRAENTRY.VALID.ENTERPAYMENTMODE'));
      setTimeout(function () {
        document.getElementById('txtVend_CustKey').focus();
      }, 10);
      return false;
    } else if (this.mObjModel.Itemkey == '' && this.mObjModel.Vend_CustKey != '') {
      //Avanish 6Jul20 SCR: 138458
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.toastMessageService.notifyError('Enter Checkbook ID');
      setTimeout(function () {
        document.getElementById('txtItemkey').focus();
      }, 10);
      return false;
    } else if (this.mObjModel2.Acct.trim() == "") {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('CONTRAENTRY.VALID.ENTERTOACCOUNT'));
      setTimeout(function () {
        document.getElementById('txtToAccount').focus();
      }, 10);
      return false;
    } else if (this.mObjModel.AcctCurrencyAmt == 0) {
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('CONTRAENTRY.VALID.ZEROAMOUNT'));
      setTimeout(function () {
        document.getElementById('txtAcctCurrencyAmt').focus();
      }, 10);
      return false;
    } else if (this.mObjModel.AcctCurrencyFact == 0) {
      //Avanish 6Jul20 SCR: 138458
      if (this.mbSearchEvent == true) {
        return false;
      }
      this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('CONTRAENTRY.VALID.CONVERTFACTOR'));
      setTimeout(function () {
        document.getElementById('txtAcctCurrencyFact').focus();
      }, 10);
      return false;
    }
    //Avanish IncNo:38025 14Sep22
    if (this.msCurrentBalance1.length > 0 && this.mObjModel.Type == 'C' && Number(this.mObjModel.AcctCurrencyAmt) > Number(this.mnumBankCurrentBal)) {
      this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('CONTRAENTRY.VALID.INSUFFICIENTBAL'));
      return false;
    }
    if (this.msCurrentBalance1.length > 0 && this.mObjModel.Type == 'B' && Number(this.mObjModel.AcctCurrencyAmt) > Number(this.mnumBankCurrentBal) + Number(this.mnODLimit)) {
      this.toastMessageService.notifyError(this.appUtility.bmgfonTranslate('CONTRAENTRY.VALID.INSUFFICIENTBAL'));
      return false;
    }
    //Validate Field Extender -- Start
    let resultString = this.FieldExtender.bmgfValidationCheck();
    if (resultString.value == false) {
      this.toastMessageService.notifyWarning(resultString.msg);
      return false;
    }
    return true;
  }
